import React from 'react';

function Nav() {
	return (
		<nav>
			<ul>
				<li>Home</li>
				<li>My Dashboard</li>
				<li>My Community</li>
				<li>Guides</li>
			</ul>
		</nav>
	);
}

export default Nav;
